void drawHex(int HexNum, int num)
{
    const int clears1[4] = {0xFFFFFF00, 0xFFFF00FF, 0xFF00FFFF, 0x00FFFFFF};
    const int clears2[2] = {0xFF00, 0x00FF};
    int *hexPtr = (int *)HEX3_HEX0_BASE;
    int *hexPtr2 = (int *)HEX5_HEX4_BASE;
    int patt = HexPattern(num);
    if (HexNum < 4)
    {
        patt = patt << (8 * HexNum);
        patt = (*hexPtr & clears1[HexNum]) | patt;
        *(hexPtr) = patt;
    }
    else
    {
        patt = patt << (8 * (HexNum % 4));
        patt = (*hexPtr2 & clears2[HexNum % 4]) | patt;
        *(hexPtr2) = patt;
    }
}

int HexPattern(int num)
{
    if (num == 0)
        return 0b00111111;
    else if (num == 1)
        return 0b00000110;
    else if (num == 2)
        return 0b01011011;
    else if (num == 3)
        return 0b01001111;
    else if (num == 4)
        return 0b01100110;
    else if (num == 5)
        return 0b01101101;
    else if (num == 6)
        return 0b01111101;
    else if (num == 7)
        return 0b00000111;
    else if (num == 8)
        return 0b01111111;
    else if (num == 9)
        return 0b01101111;
    else
        return 0b00000000;
}

Ship translateShip(Ship myShip, int x, int y)
{
    //apply translation to myShip
    myShip = translateX(myShip, x);
    myShip = translateY(myShip, y);
    return myShip;
}

Ship translateY(Ship myShip, int y)
{
    int len = myShip.type;
    Ship justInCase = myShip;
    for (int iter = 0; iter < len; iter++)
    {
        int newY = myShip.Segments[iter].Y + y;
        if (newY < 0 || newY > 9)
        {
            return justInCase;
        }
        else
        {
            myShip.Segments[iter].Y = newY;
        }
    }
    return myShip;
}

Ship translateX(Ship myShip, int x)
{
    int len = myShip.type;
    Ship justInCase = myShip;
    for (int iter = 0; iter < len; iter++)
    {
        int newX = myShip.Segments[iter].X + x;
        if (newX < 0 || newX > 9)
        {
            return justInCase;
        }
        else
        {
            myShip.Segments[iter].X = newX;
        }
    }
    return myShip;
}

Ship rotateShip(Ship myShip)
{
    bool rotateToDown = true;
    if (myShip.Segments[0].X == myShip.Segments[1].X)
    {
        // if two X coords are same (ship is vertical) and need to rotate up
        rotateToDown = false;
    }
    if (rotateToDown)
    { //rotate Down
        myShip = rotateDown(myShip);
    }
    else
    { //rotate Up
        myShip = rotateUp(myShip);
    }
    return myShip;
}

Ship rotateUp(Ship myShip)
{
    if ((myShip.Segments[0].X + myShip.type - 1) > 9)
        return myShip;
    int len = myShip.type;
    int allY = myShip.Segments[0].Y;
    int startX = myShip.Segments[0].X;
    for (int iter = 1; iter < len; iter++)
    {                                            //for all points after the topRight Point
        myShip.Segments[iter].X = startX + iter; //move down X as needed
        myShip.Segments[iter].Y = allY;          //all have same Y
    }
    return myShip;
}

Ship rotateDown(Ship myShip)
{
    if ((myShip.Segments[0].Y + myShip.type - 1) > 9)
        return myShip;
    int len = myShip.type;
    int allX = myShip.Segments[0].X;
    int startY = myShip.Segments[0].Y;
    for (int iter = 1; iter < len; iter++)
    {                                            //for all points after the topRight Point
        myShip.Segments[iter].X = allX;          //all have same X
        myShip.Segments[iter].Y = startY + iter; //move down Y as needed
    }
    return myShip;
}

