int selectGameMode()
{
    volatile int *sw_ptr = (int *)SW_BASE;

    int sw_val = 0;
    bool upDown0 = 0;
    bool upDown1 = 0;

    while (1)
    {
        //Get Switch values
        sw_val = *(sw_ptr);

        //Check SW0
        if ((sw_val & 0x1) == 1)
        {
            upDown0 = 1;
        }
        else if (upDown0)
        {
            return 0;
        }

        //Check SW1
        if ((sw_val & 0b10) == 2)
        {
            upDown1 = 1;
        }
        else if (upDown1)
        {
            return 1;
        }
    }
}